struct Solution;

use std::collections::HashMap;

const BASE: u64 = 257;
const PRIME: u64 = 1000000007;

impl Solution {
    pub fn longest_dup_substring(s: String) -> String {
        let s = &s.into_bytes()[..];

        let mut hashes = Vec::with_capacity(s.len() + 1);
        let mut hash = 0;
        hashes.push(hash);
        for &ch in s.iter() {
            hash = (hash * BASE + ch as u64) % PRIME;
            hashes.push(hash);
        }

        let mut low = 0 as usize;
        let mut high = s.len();
        let mut candidate = &s[0..0];
        while low < high {
            let mid = low + (high - low) / 2;
            if let Some(slice) = Self::get_dup_substring(s, mid, &hashes) {
                candidate = slice;
                low = mid + 1;
            } else {
                high = mid;
            }
        }
        match candidate.len() {
            0 => "".to_string(),
            _ => String::from_utf8(candidate.to_vec()).unwrap(),
        }
    }

    // Rabin-Karp algorithm to find a duplicate string of given length
    fn get_dup_substring<'a>(s: &'a [u8], length: usize, hashes: &[u64]) -> Option<&'a [u8]> {
        if length == 0 {
            return None;
        }
        let mut hash_to_idx = HashMap::new();

        // safely do base^length
        let power = (0..length as u64).fold(1, |acc, _| (acc * BASE) % PRIME);
        for i in length..s.len() + 1 {
            let last_char_removed = (hashes[i - length] * power) % PRIME;
            let hash = (hashes[i] + PRIME - last_char_removed) % PRIME;
            if let Some(&j) = hash_to_idx.get(&hash) {
                let substr = &s[j..j + length];
                if &s[i - length..i] == substr {
                    return Some(substr);
                }
            } else {
                hash_to_idx.insert(hash, i - length);
            }
        }
        None
    }
}

fn main() {
    assert_eq!("ana", Solution::longest_dup_substring("banana".to_string()));
    assert_eq!(
        "ananana",
        Solution::longest_dup_substring("banananana".to_string())
    );
    assert_eq!("", Solution::longest_dup_substring("abcd".to_string()));
    assert_eq!("aeeebaabd", Solution::longest_dup_substring("".to_string()));
    assert_eq!("dccdbcebdda", Solution::longest_dup_substring("".to_string()));
    assert_eq!("maoli", Solution::longest_dup_substring("".to_string()));
    assert_eq!("bbaababaabbbbaabaaaababbbabbbb", Solution::longest_dup_substring("".to_string()));
}
